import logo from "./logo.svg";
import "./App.css";
import Header from "./my_components/Header";
import ToDos from "./my_components/ToDos";
import Footer from "./my_components/Footer";

function App() {

  let todos = [
    {sno: 1,
      title: 'Go to the market',
      des:" You need to go the market"
    },
    {
      sno: 2,
      titl: 'Code',
      des:"You need to code today"
    }
  ]
  return (
    <>
     <Header title="To Do List" greet = "Hello" searchBar={true} />
     <ToDos todo={todos}/>
     <Footer />
    </>
  );
}

export default App;
